import React from "react";
import "./styles.css"

function DynamicSheets (){
  return <div className = "dynamic-sheets">
    <h1>Title</h1>
    <p>Content</p>
    <p>Total</p>
  </div>
}


function App() {
  return (
    <div className="dynamic-container">
      <DynamicSheets/>
      <DynamicSheets/>
      <DynamicSheets/>
    </div>
  );
}

export default App;
